import { useNavigate } from 'react-router-dom'

function ShowOne({person}) {
  const nav = useNavigate()
  return (
    <div className='app'>
          <h1>ShowOne</h1>
          {person &&
          <div>
            <h2>{person.name}</h2>
            <h3>{person.age}</h3>
          </div>
          }
          <button>Go back</button>
    </div>
  )
}

export default ShowOne
